function ButtonsSelector({ buttons, setSelected, ...rest }) {
    return (
        <div className="button-selector-div">
            {buttons.map(text => {
                const i = buttons.indexOf(text);
                return (
                    <button
                            key={text}
                            className="button-selector"
                            onClick={() => setSelected(i)}
                            {...rest}
                    >
                        {text} {i}
                    </button>
                )
            })}
        </div>
    );
}

export default ButtonsSelector;
